import React from "react";
import Blog from "./Blog";
const _ = require("lodash");
const BlogList = ({ blogs, loginStatus }) => {
  const sortedBlogs = _.sortBy(blogs, (blog) => {
    return blog.likes;
  });
  if (loginStatus) {
    return (
      <div>
        <h2>blogs</h2>
        {sortedBlogs.map((blog) => (
          <Blog key={blog.id} blog={blog} />
        ))}
      </div>
    );
  } else {
    return null;
  }
};

export default BlogList;
